import React from 'react'
import styled from 'styled-components'
import CourseMap from './CourseMap'
import Footer from './footer'

const Dashboard = () => {
  return (

    <Container> 

      <Wrapper> 
      <Hello> HELLO. </Hello>
      <Line>
      <Heading1> EDUCATION</Heading1>
      <Heading2> PROJECTS</Heading2>
      <Heading3> CONTACT </Heading3>
       </Line> 

      </Wrapper>


<Wrapper2> 
      <Ellipse> 
        <Name> 
          FILIP HAMRELIUS
          </Name>
      </Ellipse>
      </Wrapper2>

  </Container> 

  )
}

export default Dashboard

const Container = styled.div`
  min-width: 100%;
  min-height: 100%;
  background-color: #DCDCDC;
`





const Wrapper = styled.div`
  position: relative;
  width: 1800px;
  height: 4000px;
  border: 1px dashed black;
  margin: 10px;
`
const Hello = styled.h2`
position: absolute;
margin-left: 5%;
margin-top: 0;
font-family: 'Helvetica Neue';
font-weight: 700;
font-size: 220px;
color: #1F1D1D;
`
const Line = styled.div`
postion: absolute;
width: 0px;
height: 4000px;
margin-top: 6%;
margin-left:11.3%;
border: 17.5px solid #1F1D1D;
`
const Heading1 = styled.h1`
position: absolute;
margin-left: 10px;
margin-top: 1000px;
font-family: 'Helvetica Neue';
font-weight: 700;
font-size: 100px;
color: #1F1D1D;
`
const Heading2 = styled.h1`
position: absolute;
margin-left: 10px;
margin-top: 1300px;
font-family: 'Helvetica Neue';
font-weight: 700;
font-size: 100px;
color: #1F1D1D;
`
const Heading3 = styled.h1`
position: absolute;
margin-left: 10px;
margin-top: 1600px;
font-family: 'Helvetica Neue';
font-weight: 700;
font-size: 100px;
color: #1F1D1D;
`


const Wrapper2 = styled.div`
  position: absolute;
  width: 1500px;
  height: 1500px;
  margin-left: 90%;
  top: 5%;
  border: 1px dashed #DCDCDC;
  margin: 10px;
`
const Ellipse = styled.div `
position: absolute;
width: 1200px;
height: 1200px;
left: 2600px;
border-radius: 50%;

background: #1F1D1D;
`
const Name = styled.h2`
position: absolute;
margin-left: -1%;
margin-top: 45%;
font-family: 'Helvetica Neue';
font-weight: 900;
font-size: 90px;
color: #DCDCDC;
`



const Text2 = styled.p`
color: #DCDCDC;
line-height: 24px;
font-size: 20px;
width: 500px;
margin-top: 100 px;
color: #1F1D1D;
padding: 30px;
font-weight: 800;
`
const Text = styled.h2`
  color: #DCDCDC;
  line-height: 24px;
  font-size: 100px;
  padding: 30px;
`
